oxy_webhelp_navlinks = {"mail_inbox_clean-d4802e2208":{"topics":[{"title":"How do I control spam and other junk mail?","shortdesc":"<p class=\"shortdesc\">Generally, your administrator will manage junk mail for you. However, if junk mail is still a problem, you can control it in a few different ways.<\/p>","href":"mail_junk_t.html","attributes":{"data-id":"mail_junk_t"},"menu":{"hasChildren":false},"tocID":"mail_junk_t-d4802e2219","topics":[]},{"title":"What do I do if I go over my mail quota?","shortdesc":"<p class=\"shortdesc\">If your administrator has set a quota for the size of your mail, and your mail application becomes larger than the limit, you will start to see warning messages that you are over quota. In addition, new mail arriving for you may be delayed, and you will not be able to save sent mail.<\/p>","href":"mail_quota_c.html","attributes":{"data-id":"mail_quota_c"},"menu":{"hasChildren":false},"tocID":"mail_quota_c-d4802e2230","topics":[]},{"title":"How do I reduce the number of meeting-related notices in my Inbox?","shortdesc":"<p class=\"shortdesc\">To keep your Inbox cleaner, you can have NotesÂ® respond to meeting invitations for you automatically, prevent invitee responses from coming to your Inbox, prevent all meeting invitations from coming to your Inbox, or remove meeting notices automatically after you respond to them.<\/p>","href":"cal_autoprocess_t.html","attributes":{"data-id":"cal_autoprocess_t"},"menu":{"hasChildren":false},"tocID":"cal_autoprocess_t-d4802e2241","topics":[]}]}};